import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Breadcrumb, BreadcrumbItem } from 'reactstrap';

function LunchMenu(props) {
    return (
        <div className = "container">
            <Breadcrumb>
                <BreadcrumbItem>
                    <Link to = "/menu" active>Menu</Link>
                </BreadcrumbItem>
                <BreadcrumbItem>
                    Lunch Menu
                </BreadcrumbItem>
            </Breadcrumb>
        </div>
    );
}
